  false,\n\t\"url\": null,\n\t\"notes\": \"Prior to America's push west toward the
  Pacific Ocean in the nineteenth century, a majority of the land within the United
  States' boundaries was virginu2014undisturbed. But, as progress and settlers spilled
  out from the crowded confines of the eastern states onto the great expanses of the
  West, much of this land was disturbed... and many ecosystems were altered, almost
  lost. Such was the case for two once dominant Midwestern ecosystemsu2014the savanna
  and the tallgrass prairie. Succumbing to the axe and plow, each was carved up and
  converted by pioneers, to be left as scattered scraps where their manipulation was
  not economical It is these scraps that the U.S. Fish and Wildlife Service seeks
  to connect and return to their original glory via the Walnut Creek National Wildlife
  Refuge. Established in 1991, the Refuge's unique goal is to restore a portion of
  the tallgrass prairie and savanna ecosystems once indicative of the Midwestern United
  States. The purpose of the study was the development of a land use history for prioritized
  sections (roughly 2500 acres) in the core of the Walnut Creek Refuge\",\n\t\"owner_org\":
